INSERT INTO `equipos_info` VALUES (1,1,'','silueta.jpg','','','',''),(2,2,'','silueta.jpg','','','',''),(3,3,'','43a781c8d83851b45ebd92da7cce8434.jpg','#1a3ad9','','',''),(4,4,'','57e92c6dec4c0d9472507e14549466cb.jpg','#700000','#850202','#f70d14','#fa0a0a'),(5,5,'','45f39070d78b0f77989b34ad68c99daa.jpg','#071938','#072347','#520808','#520c0c'),(6,6,'','silueta.jpg','','','',''),(7,7,'','cd9d890c01600eb4bd5d3708bdb84039.jpg','#ff6b08','#1d09f0','#169106','#f7f7f7'),(8,8,'<p>La historia de este equipo data de hace por lo menos 10 a&ntilde;os, cuando en las miticas canchas del Club Atletico del Rosario, desarrollaba entre sus clasicos jugadores ( y algunos que ya no estan) partidos de futbol frente a la gente del Rugby. Los partidos se llevaban a cabo en inferioridad numerica, con impunidad total ; pero pese a todo se llevaba la frente en alto y el orgullo de ser integrante de esta insignia. El nombre fue mutando. Alla por 2007 disputamos un torneo futbol 5 llamandonos por entonces VIEJO DIVINO FC, donde alcanzamos cuartos de final quedandonos en el camino.</p>\n<p>Luego en 2009 disputamos un torneo indoor a mitad de a&ntilde;o de 4 jugadores en el gimnasio de CAR, donde conseguimos el titulo pese a muchas lesiones. Ese mismo a&ntilde;o no concluimos el torneo interno Carlos Jewell en cancha de 7, pero ya era casi un hecho la conformacion de este elenco. Luego a principios de 2010 se sello la afiliacion al torneo Stella Maris. En el primer torneo, y para no ser menos en nuestra historia, alcanzamos el titulo en la categoria E, venciendo en la final a Chau pichu por 2-0. Tambien derrotamos duros rivales como AFA.</p>\n<p>El segundo torneo de 2010 alcanzamos las semifinales siendo derrotados en la semifinal por Ferrugem.</p>\n<p>Ya en 2011 y luego de varios ascensos para que el torneo se adecue a nuestro nivel, logramos el ascenso a la categoria A. Donde en nuestro primer torneo pedimos en semifinales a manos de ACME.</p>\n<p>En el final de 2011 tambien fuimos derrotados por Acme cerca de la final del torneo.</p>\n<p>Este 2012 para TNT no puede tener otro objetivo que el de ser campeon . La capacidad, el trabajo y el sacrificio de sus jugadores, asi como su mistica a lo largo de tantos a&ntilde;os; no puede aspirar a metas menores. Las nuevas incorporaciones, asi como las generaciones venideras tendran la obligacion de adaptarse a llevar en la sangre y en la frente, esta insignia que representa tanto para todos nosotros ..</p>\n<p><strong>SALUD TNT</strong></p>\n<p>&nbsp;</p>','89fc022f71c4fa27ff8ac98812939eba.JPG','#6d7dbf','#ffffff','#4a4c54',''),(9,9,'','9e3c98315a46aa8421186eec5355711c.JPG','#730707','','',''),(10,10,'','silueta.jpg','','','',''),(11,11,'','silueta.jpg','#ed0909','#fa0a0a','#defa0a',''),(12,12,'<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px; background-color: rgba(255, 255, 255, 0.917969);\">As&iacute; comenz&oacute; todo...</span></p>','c064b176cffb69f5ff8c6406fcc7560a.jpg','#0f1ebf','#e01010','#ffffff','#2a19e6'),(13,13,'<p>1998 - Torneo \"Area 18\"</p>\n<p>2011 - Torneo Stella Maris (Campe&oacute;n Apertura Categor&iacute;a \"C\")</p>','31bcb3375f2d08688d56cf2d45994fbb.JPG','#ffdf3d','#080707','#f50e0e','#e5f531'),(14,14,'<p><span style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 18px;\">COCOON EL GRAN CAMPE&Oacute;N</span><br style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 18px;\" /><br style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 18px;\" /><span style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 18px;\">LA HISTORIA DE COCOON SE REMONTA AL A&Ntilde;O 2010, EN UN COMIENZO EN LOS TORNEOS DONDE PARTICIPO ALTERNO BUENAS Y MALAS ACTUACIONES, A MEDIADOS DEL A&Ntilde;O PASADO LA MAYOR&Iacute;A DE LOS JUGADORES QUE CONFORMABAN LA PLANTILLA NO SIGUIERON M&Aacute;S EN EL EQUIPO, ENTONCES SU ARQUERO LUCIANO DALLI FORMO UN NUEVO PLANTEL INTEGRADO POR NUEVOS JUGADORES QUE COMENZARON A JUGAR EN LA CATEGORIA B DONDE</span></p>\n<div class=\"text_exposed_show\" style=\"display: inline; color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 18px;\">&nbsp;SE CONSAGRARON CAMPEONES. POR PRIMERA VEZ, EN ESE A&Ntilde;O SE DISPUTO LA COPA DE CAMPEONES, TROFEO OBTENIDO POR COCOON.<br /><br /><br /><br />EL OBJETIVO PARA LA PRIMERA MITAD DEL A&Ntilde;O PASABA POR CONQUISTAR EL TORNEO APERTURA 2012. TAREA ARDUA QUE FINALMENTE SE CONSIGUIO: DE LOS 14 PARTIDOS DISPUTADOS SOLO PERDIERON EN UNA OCASI&Oacute;N FRENTE AL SUBCAMPE&Oacute;N LAS PALMERAS. ES UN ELENCO QUE DONDE LOS JUGADORES QUE INGRESAN CUMPLEN A LA PERFECCI&Oacute;N EL PLAN DE JUEGO QUE PERSIGUE EL CONJUNTO, DESDE EL ARCO LUCIANO DALLI ES UN ARQUERO QUE REFLEJA UNA GRAN SEGURIDAD TIENE UNA GRAN VOZ DE MANDO Y ES EL CREADOR DEL EQUIPO DE COCOON A LO LARGO DEL CAMPEONATO RECIBIO 12 GOLES EN CONTRA. POR OTRO LADO FUE EL EQUIPO M&Aacute;S GOLEADOR DE LA CATEGOR&Iacute;A MARCANDO 38 GOLES, M&Aacute;S NO SE POD&Iacute;A ESPERAR AL CONTAR CON GOLEADORES DE LA TALLA DE DARIO GONZALEZ QUIEN MARCO 13 GOLES Y JOSUE GONZALEZ CON 5 TANTOS. UN GRAN CAUDILLO EN EL CONJUNTO ES EL DEFENSOR GABRIEL GONZALEZ, ES UN JUGADOR QUE EN LOS MOMENTOS M&Aacute;S TENSOS TRASMITE UNA GRAN TRANQUILIDAD, EN EL MEDIO APARECE MIGUEL BRITES, ENCARGADO DE LA DISTRIBUCI&Oacute;N DEL BAL&Oacute;N QUIEN POSEE UNA GRAN CALIDAD. PARA ELLOS SIEMPRE SE DEBEN CUMPLIR CON LOS OBJETIVOS Y AHORA BUSCARAN EL TORNEO CLAUSURA Y REVALIDAR NUEVAMENTE LA COPA DE CAMPEONES. FELICITACIONES CAMPEONES</div>','88ec3470edefe7ee9776262ef31d76b4.jpg','#ffffff','#ffffff','',''),(15,15,'<p>El equipo se origin&oacute; en unas vacaciones con compa&ntilde;eros de la facultad en Brasil a inicios del a&ntilde;o 2009. Mientras disfrutabamos las hermosas playas de Brasil el \"hereje\" y \"viril\" de Federico Serra siempre recordaba, \"que mal que nos va!\", lo dijo tantas veces que nos qued&oacute; esa frase. Al volver del viaje nos propusimos entrar en una liga de f&uacute;tbol y el nombre sali&oacute; solo: <strong>Mal me Va CP</strong>. Las &uacute;ltimas siglas se debe a que somo casi todos Contadores P&uacute;blicos. Que tul?</p>','bff95aab2fb40a2cb85eae2c5ab7fa2a.JPG','#0c871b','','','#18db56'),(16,16,'','ffcfaa4ea3e3744a4da8aef0300e8c69.jpg','#edeaea','#1100fc','#ffffff','#000000'),(17,17,'<p>Bi campeon del torneo de verano. Copa de Plata 2009 y 2010.</p>','4a936442cccbc8e55baf459743877a93.jpg','#f500d8','#ff00ff','#f7f7f7','#d900c0'),(18,18,'','silueta.jpg','','','',''),(19,19,'','silueta.jpg','','','',''),(20,20,'','silueta.jpg','','','',''),(21,21,'<p><strong><span class=\"fcg\">Equipo conformado por un grupo de amigos que no tenian suficientes escusas para boludear juntos y decidieron tambien jugar un torneo asi podian pasar las tardes de sabado reuniendo anecdotas y organizando el sabado a la noche..</span></strong></p>','4f9b958ce78a9e04fc2b95ec8c7a8522.jpg','#1fde2c','','#132ced','#48e855'),(22,22,'','silueta.jpg','','','',''),(23,23,'','silueta.jpg','','','',''),(24,24,'','silueta.jpg','','','',''),(25,25,'','silueta.jpg','','','',''),(26,26,'','silueta.jpg','','','',''),(27,27,'','92d03c1f524df5311acdd4ab2152d857.jpg','#eb3434','#f4fcf9','#f2f2f2','#ff002b'),(28,28,'','silueta.jpg','','','',''),(29,29,'<p>Este equipo se forma del ex 200 de Salame. Con viejos y nuevos jugadores. Un mix del cual surge UNION. la UL.</p>','silueta.jpg','#f7fcf8','#f20038','#faf7f7','#13ed46'),(30,30,'','536fdf52fcc36aa739edac9d918d25b0.jpg','#121112','','',''),(31,31,'<p>Albatros es un equipo que nace a partir de una participacion en el torneo de judiciales en el a&ntilde;o 2003 de alli esta el dia de hoy el equipo mantiene los pilares de sus primeros jugadores, con varios titulos obtenidos en diferentes a&ntilde;os y torneo, albatros siempre fue un equipo formado por amigos y donde siempre lo importante es juntarse los sabados, siempre apostando a ganar y al el gol. hoy nos encontramos en este torneo donde el equipo va creciendo de menor a mayor, arrancando en la zona D2 despues de la participacion del torneo de verano 2011 y logrando dos ascensos consecutivos, en un a&ntilde;o exelente nos encontramos en la zona b....la historia sigue, Albatros no se rindee nunca</p>','e440c73f1fb4b121b6d7a2ed475e561f.jpg','#e82e2e','#20bae0','#0a0101','#f00909'),(32,32,'','silueta.jpg','','','',''),(33,33,'','silueta.jpg','','','',''),(34,34,'','silueta.jpg','','','',''),(35,35,'','6ad5db69289ace90dce3a5b443609ebe.gif','#149c0f','','',''),(36,36,'','silueta.jpg','','','',''),(37,37,'','51a6175281c6384b0d2a216cd0abc1ae.jpg','#164702','#0b0694','#fcf4f4','#080808'),(38,38,'','silueta.jpg','','','',''),(39,39,'','1efab58fd0c7d946147b0302780b22d5.jpg','#ebe6e6','#f2eaea','#220ef5','#0729d4'),(40,40,'','silueta.jpg','','','',''),(41,41,'','silueta.jpg','','','',''),(42,42,'','silueta.jpg','','','',''),(43,43,'<p>HAY EQUIPO SE CREO EN EL A&Ntilde;O 2005, CUANDO NO SABIAMOS QUE NOMBRE PONERLE Y SOLO SE NOS OCURRIO ESE AL MIRAR UN PROGRAMA EN TYC SPORTS, DE AQUEL EQUIPO SOLO SEGUIMOS FACUNDO Y MATIAS(QUIEN LES HABLA), EL RESTO FUE CAMBIANDO HASTA EL DIA HOY QUE PUDIMOS ARMAR UNA BASE DE BUENOS JUGADORES Y AMIGOS, QUE LO QUE MAS NOS IMPORTA</p>','986dc73f06c75568f88b77ca0defa4ad.PNG','#5c00fc','','#f09a60',''),(44,44,'','9f1cb86cbb497270905d1f5cb1aed56e.jpg','#e3dfdf','#242121','#c40a9f','#bf19bf'),(45,45,'<p>545454</p>','e9544aca056ba7fb9c7d1e8960e0bd26.jpg','#082fc9','#f77903','#fc7f0a','#f5700a'),(46,46,'<p>La historia de este club, comienza en el a&ntilde;o 2010, en un 5to a&ntilde;o del colegio San antonio de padua, donde Santiago Vidal, y Ezequiel Solezzi decidieron armar un equipo. Hasta que sono el nombre \"Los Halcones Galacticos\"&nbsp;<span style=\"font-family: sans-serif; font-size: 13px; line-height: 19px;\">(Silverhawks)&nbsp;</span>haciendo memoria a esa serie animada del 86.</p>\n<p>Mas tarde se fueron sumando amigos, familiares, conocidos hasta lograr el plantel de hoy. El club tuvo una decaida en el 2011 justo cuando arranco el torneo, hubo traiciones, mentiras, e internas en el club, que se hicieron notar en la cancha, este a&ntilde;o espera mostrar la verdadera cara de los Halcones.</p>','71ecdfca4e15148582263c1248a72851.JPG','#6fa9e8','','',''),(47,47,'','efc04e25c6c0d1d96ae6c0e8d4fb3dbd.jpg','#802f77','#141111','#ffffff','#000000'),(48,48,'','silueta.jpg','#850a4a','#8a0b48','',''),(49,49,'','silueta.jpg','','','',''),(50,50,'','silueta.jpg','#360eb8','#1025a8','#ffcc00','#ffc400'),(51,51,'','silueta.jpg','','','',''),(52,52,'','silueta.jpg','','','',''),(53,53,'','silueta.jpg','#faf2f3','#f6faf5','',''),(54,54,'','silueta.jpg','','','',''),(55,55,'','silueta.jpg','#1e46c9','#ffffff','#a43da8','#0d0c0c'),(56,56,'<p>Verdeamarello se form&oacute; en enero de 2009 como excusa para que el grupo de amigos que somos pasemos un sabado a la tarde haciendo lo que mas nos gusta...jugar al futbol. Jugamos para ganar, y nuestro objetivo cada a&ntilde;o es salir campeon de todo lo que juguemos. Con varios campeonatos ganados, no perdemos el hambre de lograr cada dia mas...ESTE A&Ntilde;O NO VA A SER LA EXCEPCION!!</p>','ff79a11e035d6f1a364a2ed4f1070707.JPG','','','',''),(57,57,'','74e4d0cad75f8c60699d85a31cab8c8a.jpg','#f2eaea','#f4fcf4','',''),(58,58,'','silueta.jpg','','','',''),(59,59,'','d682636b632fd5a3e9f16615bcb7ccf9.jpg','','','',''),(60,60,'','silueta.jpg','','','',''),(61,61,'','24329e543ca834af0baf133945edb404.JPG','','','',''),(62,62,'','c79946b3f2282114298577324c5e2615.jpg','#f29b9b','#f79ea8','#089919',''),(63,63,'<p>Una Banda de Locos Lindos... bue \"lindos\"...</p>','1e295d3ce5cb28db9f84eda1f1f5d1e6.jpg','#160abd','#ffffff','#f2f20c',''),(64,64,'','silueta.jpg','','','',''),(65,65,'','4f1393c09b75c27e14a6410afd580196.jpg','#2503ad','#e9e9f2','#f7eded','#231ca8'),(66,66,'<p>Malvinas Argentinas, nace como un peque&ntilde;o grupo de amigos, que tenian muchas ganas de comer asado. Por tal motivo decidieron comenzar a reunirse y por tanto, buscaron un lugar.</p>\n<p>Club Malvinas Argentinas fue ese lugar donde este grupo de amigos pudo lograr tal objetivo, creando lo que se llama \"Bendito Jueves\" y \"MAFC Malvinas Argentinas Futbol Club\".</p>\n<p>Hoy un equipo con mas de 4 a&ntilde;os de antiguedad y un inmeso hambre de gol, demuestra todo lo que sabe de futbol y asados, cada sabado en TFSM.</p>','af7904b1dfda42f1389d5032c960db76.jpg','#296fba','#ffffff','',''),(67,67,'','0b638e340d93f931c2b755b53e2be37f.jpg','#ed0707','#ffffff','',''),(68,68,'<p>Metele Plomo es en equipo formado por compa&ntilde;eros de trabajo de una corredora de cereales. Juntos compartimos el dia a dia en la oficina y los sabados, tratamos de divertirnos dentro de una cancha.</p>','336166482051a11eeeb471eb06863ea4.JPG','#f5f5f5','#06066e','#f77c1e',''),(69,69,'','silueta.jpg','','','',''),(70,70,'','silueta.jpg','','','',''),(71,71,'','silueta.jpg','','','',''),(72,72,'<p>Mas info en <a href=\"http://www.fernet-rfc.com.ar/\">http://www.fernet-rfc.com.ar/</a></p>','074ee9ad3a1e98fc88cc459728a22409.jpg','#41a7eb','#050505','#168a24','#fcf9f9'),(73,73,'','2cb9101589e045f08c6770267df3e53a.jpg','#4c26e3','#f22424','',''),(74,74,'','silueta.jpg','#d41515','','',''),(75,75,'','silueta.jpg','','','',''),(76,76,'<p>\"&gt;</p>','232b6bd90f3eb2ae765096f52a94b539.JPG','#ffffff','#ffffff','',''),(77,77,'<p>Equipo formado por ex jugadores de equipos como El Sanjo y Los Satrapas; sumandose gente unida por las mismas pasiones: AMISTAD, FIESTA, Y FUTBOL.</p>','silueta.jpg','#0eb535','#ffffff','','#0a0a0a'),(78,78,'','silueta.jpg','','','',''),(79,79,'','silueta.jpg','','','',''),(80,80,'','silueta.jpg','','','',''),(81,81,'<p>&nbsp;</p>\n<p class=\"MsoNormal\">Todo comienza con un grupo de amigos que se conoc&iacute;an desde el colegio, un grupo inseparable lleno de experiencias inolvidables. Campamentos, viajes, salidas y muchas cosas m&aacute;s. Pero siempre le falt&oacute; algo a este grupo, siempre le falto armar un equipo de futbol. Por varias cosas nunca se pudo dar: algunos jugaban en otras ligas, otros simplemente hab&iacute;an colgado los botines. Siempre se hablaba de armar el equipo pero nunca se concretaba.</p>\n<p>&nbsp;</p>\n<p class=\"MsoNormal\">Hasta que un d&iacute;a Jorge B. Delgado y Juan M. Ghiotti<span>&nbsp; </span>tomaron la iniciativa para este sue&ntilde;o y decidieron finalmente armar el equipo y jugar en el Torneo Stella Maris. Se hablo mucho en el mes de diciembre del 2010 y enero del 2011 y<span>&nbsp; </span>la mayor&iacute;a dijo que se iban a comprometer para que este sue&ntilde;o se haga realidad.</p>\n<p>&nbsp;</p>\n<p class=\"MsoNormal\">Hubo muchas complicaciones para elegir el nombre del equipo. Todas las propuestas eran un fracaso total: Cianuro, Decepticon FC, Branca, West Side, Ana Julia FC. No se centraba en lo que era el grupo sino que se tiraban nombres al azar. El nombre era muy importante, ten&iacute;a que representar alg&uacute;n hecho o cualidad del curso. Hasta que alguien tir&oacute;: PUCON.</p>\n<p>&nbsp;</p>\n<p class=\"MsoNormal\">Pero que significa Pucon? Un integrante del grupo ten&iacute;a una gorra blanca, la cual usaba 6 d&iacute;as a la semana aprox. Esta gorra ten&iacute;a escrito: Pucon. Nadie supo porque le gustaba tanto, y nadie sabe si alg&uacute;n d&iacute;a esa gorra realmente pas&oacute; por el lavadero. Pero la verdad es que esa gorra, llamada Pucon, acompa&ntilde;o a todos los viajes que hizo este grupo, Pucon siempre dijo presente en los momentos &uacute;nicos de este grupo de amigos.</p>\n<p>&nbsp;</p>\n<p class=\"MsoNormal\">Y as&iacute; surgi&oacute; este equipo. Uno que prioriza la amistad dentro del grupo por encima de rendimientos o resultados dentro de la cancha. Un equipo cuya finalidad no es otra que ser una excusa m&aacute;s para juntarse y seguir compartiendo an&eacute;cdotas como desde hace 16 a&ntilde;os. Un equipo que se sigue preguntando si esa gorra se lavar&aacute; alguna vez&hellip;</p>\n<p>&nbsp;</p>','6b5b0378ce545c9fb5edc3b272c8eabc.jpg','#f2700c','#f56e0e','',''),(82,82,'','97b572b1b14ee7ff4256795262beff7f.jpg','#0a0a0a','#0ef028','#09e823','#f70808'),(83,83,'','silueta.jpg','','','',''),(84,84,'','0cb141e647e2075efd4b184d1bcd5046.jpg','','','',''),(85,85,'<p>Alla por el 2008, un viernes frio, observamos el asado que estaba a punto de servirse. Luego de la sobremesa, se comenz&oacute; el tan ansiado torneo de play. Cuando de repente uno de los chicos, mientras sostenia su vaso de Fernet en su mano derecha, miro fijamente sus ojos y le dijo: &iquest;por qu&eacute; no nos hacemos un equipo de futbol y nos dejamos de boludear con esto? Esa misma noche, en la localidad vecina de Funes, se fund&oacute; el Club Atletico Niupi, el cual a sido modificado en los &uacute;ltimos a&ntilde;os por la nominaci&oacute;n America F.C. El equipo esta formado por una decena de personajes simpaticos amantes del jugo bonito. Nos caracteriza el amor por la camiseta y la rabia frente a los arbitros. Mordemos!!! El equipo comparte un mismo coraz&oacute;n, guerrerro, valiente, y apasionado. Las victorias consecutivas fortalecieron la alianza de estos gladiadores que cada fin de semana se juegan una final para brindar una alegria a sus hinchas. Tan seguidores e incondicionales. \"America F.C. hasta la victoria siempre\"!!!!!!!</p>','silueta.jpg','#f70505','#faf7f7','','#fa0303'),(86,86,'','silueta.jpg','','','',''),(87,87,'','41410d4d217e03760f21083916e2c9da.jpg','#f7f7f2','#341ad9','',''),(88,88,'<p>\"&gt;</p>','c58cc9d94a6056355726ba750a456fb0.jpg','#e376d1','#0000f7','#72a1e8','#edf2f7'),(89,89,'','e4a4d1fb430e62dcf97c6fc19219a863.jpg','#085c0f','#0d0c0c','#eded21','#0f0e0e'),(90,90,'','silueta.jpg','#000000','','',''),(91,91,'<p>&nbsp;</p>\n<p>&nbsp;</p>','d578e141fdc32a6ff9946e5c5fe7a56c.jpg','#0a0a0a','#0f0e0e','#ffffff','#fffefa'),(92,92,'<p>Campeon 2008 Torreon</p>\n<p>Campeon 2009 Judiciales</p>\n<p>Campeon 2010 Judiciales</p>\n<p>Campeon 2011 Stella Maris</p>\n<p>&nbsp;</p>\n<p>masomeno...</p>','6989d752ae20550fcab8c404cd11c752.jpg','#030000','#63c1ed','#fffff7','#1debda'),(93,93,'','silueta.jpg','','','',''),(94,94,'<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 53.0px Helvetica;\"><strong>CLUB DE AMIGOS LA FULANA</strong></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"margin: 0.0px 0.0px 10.0px 0.0px; text-align: center; font: 20.0px Verdana;\">LaFulaaa! LaFulaaa! LaFula LaFula LaFulaaa!!!</p>','d38707fee30bced5afce337a4388c9c1.jpg','#2731f2','#0a0a0a','#ff0000','#e80303'),(95,95,'','silueta.jpg','','','',''),(96,96,'','silueta.jpg','','#0535f5','',''),(97,97,'<p><span class=\"fcg\"><span style=\"color: #808080;\">WIGAN FC arranc&oacute; en la liga a principios del 2011 donde lleg&oacute; a obtener el segundo puesto despu&eacute;s de un excelente campeonato en la categor&iacute;a E3.&nbsp;En la segunda mitad del a&ntilde;o el&nbsp;plantel busca el merecido ascenso. Es un equipo que se&nbsp;caracteriza por el buen f&uacute;tbol y por su orden t&aacute;ctico.</span></span></p>','40df98d3a988de91f68c992140b7aeff.jpg','#000000','#e3bf0d','#fffcfc','#2205fc'),(98,98,'','silueta.jpg','','','',''),(99,99,'','eed57f3b01bbd7625459a028c0a28d5c.JPG','#0cd5f0','#fafafa','',''),(100,100,'<p>Deportivo Espa&ntilde;ol se fundo en septiembre de 2011: Grupo de amigos del colegio, somos un equipo muy mezquino con unos huevos terribles pero limitados futbolisticamente. Somos de la escuela de caruso lombardi; ACTUALMENTE EN PRIMERA DIVISION.</p>\n<p>2011: CATEGORIA E</p>\n<p>2012: CATEGORIA E</p>\n<p>2013:ASCIENDE A LA D, C Y FINALMENTE A LA B.</p>\n<p>2014: ASCIENDE A LA A, JUGANDO UNA PROMOCION</p>','acf171118e0496f49a628c3b6d3e294f.jpg','#030840','#f21313','#f7f2f5','#ed1f0c'),(101,101,'<p><strong><span class=\"fcg\">Lexotanil F&uacute;tbol Club. Fundado el 03 de Abril del 2011 por un grupo de j&oacute;venes amigos. </span></strong></p>\n<p><strong><span class=\"fcg\">Apodos: \"La Pastilla\", \"La Pasti\", \"El Pastillero\", \"Lexo\".<br /> Actualmente el Equipo se encuentra disputando el Torneo Stella Maris de Fisherton en la zona E4.</span></strong></p>\n<p><span class=\"fcg\"><strong>lexotanilfc@hotmail.com</strong><br /></span></p>\n<p><span class=\"fcg\"><br /></span></p>\n<p>&nbsp;</p>','8de4ac4d2b95d66bd1ef91fc50264d1f.jpg','#f0cdf7','#45a0d1','#47a6cc','#eff1f2'),(102,102,'','silueta.jpg','','','',''),(103,103,'','0e5f9d4d333e577e73b8231df7731473.jpg','#fcf9f9','#050000','#080101',''),(104,104,'<p>El gran Deportivo Cacho nacio el 2008 jugando al futbol 5, y en este momento jugando en el stella maris. Un conjunto a puro huevo que no da una por perdida</p>','fe8f27e62491a86166277eab0e9b0f4d.jpg','#0e0e0f','#ededf0','#2817e8','#141313'),(105,105,'','silueta.jpg','','','',''),(106,106,'','silueta.jpg','','','',''),(107,107,'<p>Big Bola</p>\n<p>el equipo de Lalo Capitan!</p>','silueta.jpg','','','',''),(108,108,'','silueta.jpg','','','',''),(109,109,'','silueta.jpg','','','',''),(110,110,'<p>La Jumanche FC<br /><br />\"No seremos los mejores... .\"</p>\n<p>\"Jooootaaa...Jota de mi viiiiiidaaa...vos sos la alegriiiiii&iacute;aaa...de mi corazoooooo&oacute;n...\"</p>\n<p>\"Jota querida...gracias por esta alegr&iacute;a\"</p>\n<p>Guimo + 6</p>\n<p>Guimo is ALL IN</p>','8f9d6ee811c94f5d7ba197cd26190022.jpg','#1e03f0','#0c0ced','',''),(111,111,'','silueta.jpg','','','',''),(112,112,'','silueta.jpg','','','',''),(113,113,'<p>A comienzo del a&ntilde;o 2010, un grupo de amigos se reuina con frecuencia tras la jornada laboral a tomar cervezas. Un 8 de abril de ese a&ntilde;o, cerca de 5 o 6 personas se congregaron en un kiosco de barrio Pichincha con la intencion de crear un club de futbol.<br />Fue entonces cuando un rosarino, llamado Facundo, propuso formalmente la creacion de aquel proyecto, sugiriendo para el mismo el nombre de <strong><em>Presidiarios de la Malta</em>.</strong>&nbsp;Los asistentes dieron su aprobacion, y eligieron como presidente al mas vehemente tomador de cervezas, al mismo <em>Facundo</em> y como vicepresidente se nombro a <em>Franco Solari</em>. Era el nacimiento del <em>granate</em>.&nbsp;<br />&nbsp;</p>\n<p>Los colores que lo identifican desde su nacimiento son el granate y blanco, con los cuales fueron desi&ntilde;ados, el escudo y la casaca deportiva.</p>\n<p>&nbsp;</p>\n<p><strong><span style=\"text-decoration: underline;\">EL QUE MAS JUGO</span></strong></p>\n<p><em><strong>Kaku Rivarola</strong></em> - 68 partidos entre 2010 a la actualidad.</p>\n<p><strong><span style=\"text-decoration: underline;\">MAXIMO GOLEADOR</span></strong></p>\n<p><strong><em>Kaku Rivarola</em></strong>&nbsp;- 61 goles</p>','92adf2a586c2b151bffd27fc21097eec.jpg','#991919','#ffffff','#0a0101','#faf7f7'),(114,114,'','silueta.jpg','','','',''),(115,115,'','silueta.jpg','','','',''),(116,116,'','silueta.jpg','','','',''),(117,117,'','silueta.jpg','','','',''),(118,118,'','silueta.jpg','','','',''),(119,119,'','silueta.jpg','','','',''),(120,120,'','silueta.jpg','','','',''),(121,12001,'<p>ITALIA NACE EN EL A&Ntilde;O 2001 EN UN TORNEO INTERNO DEL CLUB REGATAS BAJO EL NOMBRE LOS RATONCITOS DE LA PRADERA (NOMBRE CON EL CUAL SIEMPRE ESTAREMOS IDENTIFICADOS). HACIENDO UN TORNEO MAS QUE ACEPTABLE, BASADO EN LA ENTREGA Y EL CONTRAGOLPE. A&Ntilde;OS DESPUES UNIDOS POR UNA GRAN AMISTAD JUGAMOS UN TORNEO NOCTURNO EN EL TORREON, DONDE SE INCORPORAN VARIRIOS AMIGOS MAS. LUEGO POR DISPOSICION DEL TORNEO HAY QUE CAMBIAR LOS NOMBRES POR PAISES, AI ES CUANDO NACE EL NOMBRE DE ITALIA. EN ESE TORNEO CONSEGUIMOS NUESTRO PRIMER TITULO COMO EQUIPO EN UN LUNES INOLVIDABLE.</p>\n<p>EMPEZAMOS OTRO CAPITULO.</p>\n<p>VAMOS LOS RATONCITOS!!!!!&nbsp;&nbsp; FORZA AZURRO!!!!!!</p>','97e431108d56fb1cf96fe4ebdbb49411.jpg','#f4f4f7','#0f08f0','#1008fc','#030101'),(122,12002,'<p><a title=\"Web Oficial\" href=\"http://www.germanfutbolclub.com\" target=\"_blank\">www.germanfutbolclub.com</a></p>\n<p><a title=\"Blog Oficial\" href=\"http://www.germanfutbolclub.blogspot.com\" target=\"_blank\">www.germanfutbolclub.blogspot.com</a></p>','af4882d6c78e3d20dead568212e3c643.JPG','#0f17ff','#e63815','#f4f5f7','#0923e6'),(123,12003,'','80d789c6ec1c56b3877cabb45094cc3b.jpg','#080a09','#12f70a','#cae3dc','#e81919'),(124,12004,'','silueta.jpg','','','',''),(125,12005,'','9dbc734f6325a4327dbd77267485d32c.jpg','','','',''),(127,12007,'<p style=\"text-align: justify;\">Fundado el 27 de Febrero de 2009, el Club Social y Deportivo <strong>REAL MANDRIL</strong> viene a continuar una vieja tradici&oacute;n de un grupo de amigos que practica este deporte hermoso para quienes lo entienden, con la idea de juntarse antes, durante y desp&uacute;es; por, para y solamente... para juntarse.</p>','71fae4161c39dfab4a567b7f5518c55a.jpg','#111469','#071687','#83e9f2',''),(128,12008,'','silueta.jpg','#faf2f2','#e84809','',''),(129,12009,'','silueta.jpg','#62c1de','#080101','#34bfdb','#fcfcfc'),(130,12010,'','silueta.jpg','','','',''),(131,12011,'','silueta.jpg','','','',''),(132,12012,'','bf926d4e3d64fe3e6cc1f6a6a5a4a504.jpg','#080a09','#524903','','#000000'),(133,12013,'','silueta.jpg','','','',''),(134,12014,'','54ebd1b6c828622ed374945fef5d0416.jpg','#1c1717','#ebdfdf','#fceaea','#e31d1d'),(135,12015,'','silueta.jpg','','','',''),(136,12016,'','silueta.jpg','#2eb01c','#121111','#0a0909','#1f8022'),(137,12017,'','silueta.jpg','','','',''),(138,12018,'','silueta.jpg','','','',''),(139,12019,'','silueta.jpg','','','',''),(140,12020,'','silueta.jpg','','','',''),(141,12021,'','silueta.jpg','','','',''),(142,12022,'','silueta.jpg','','','',''),(143,12023,'<h2 class=\"uiHeaderTitle\" style=\"font-size: 16px; color: #1c2a47; margin: 0px; padding: 0px; outline: none; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; text-align: left;\">Scudetto - Una pasi&oacute;n sin finaaaal<br /><strong><span style=\"color: #333333; font-size: 11px; line-height: 16px;\">Podr&aacute;n pasar mil cosas en este equipo... para bien o para mal...</span></strong></h2>\n<p style=\"margin: 0px; font-size: 11px; line-height: 16px; color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; text-align: left;\">Pero hay algo que sabemos todos... somos compa&ntilde;eros, amigos :)</p>\n<p style=\"margin: 0px; font-size: 11px; line-height: 16px; color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; text-align: left;\">Yo se que &uacute;ltimamente hubo muchas peleas y discusiones entre nosotros... pero sabemos que lo hacemos para mejorar...&nbsp;</p>\n<p style=\"margin: 0px; font-size: 11px; line-height: 16px; color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; text-align: left;\">Podremos perder... podremos ganar... pero somos Scudetto y siempre tratamos de dejar todo dentro y fuera de la cancha...&nbsp;</p>\n<p style=\"margin: 0px; font-size: 11px; line-height: 16px; color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; text-align: left;\">Tratemos de no perder las charlas, las cocas tomadas, los tenis f&uacute;tbol, las previas antes del partido y sobretodo ese buen humor que tenemos... todo esto es lo que se pens&oacute; hace un a&ntilde;o para crear a Scudetto, un grupo de amigos, que jugamos para divertirnos principalmente... pero a mi como creo que ustedes tambi&eacute;n les pasa mas all&aacute; de divertirnos y jugar... queremos ganar!! Y es l&oacute;gico... pero para eso tenemos que responsabilizarnos y tratar de sacar la mejor soluci&oacute;n...&nbsp;</p>\n<p style=\"margin: 0px; font-size: 11px; line-height: 16px; color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; text-align: left;\">No sirve de nada pelear (cada uno sabe para quien va)&nbsp;A pesar de esto... h&aacute;ganse la pregunta de que porque seguimos siendo SCUDETTO FC...&nbsp;Es porque somos un EQUIPO!! y esto no va a cambiar...&nbsp;Aparte hay equipo y lo sabemos... por eso pensamos en ganar... Y siempre que perdemos tratamos de ver que tenemos que mejorar para el pr&oacute;ximo partido aunque sabemos que la mayor&iacute;a de los partidos merecemos ganar, pero por una cosa o por otra no podemos...&nbsp;</p>\n<p style=\"margin: 0px; font-size: 11px; line-height: 16px; color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; text-align: left;\">&nbsp;</p>\n<p style=\"margin: 0px; font-size: 11px; line-height: 16px; color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; text-align: left;\">En fin esto me puse a escribirlo para tratar de estar mas unidos... as&iacute; que no perdamos la amistad que tenemos... que es lo principal...&nbsp;</p>\n<p style=\"margin: 0px; font-size: 11px; line-height: 16px; color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; text-align: left;\">&nbsp;</p>\n<p style=\"margin: 0px; font-size: 11px; line-height: 16px; color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; text-align: left;\">AS&Iacute; QUE PONG&Aacute;MONOS LAS PILAS Y A GANAR EL CLAUSURA!!!&nbsp;</p>\n<p style=\"margin: 0px; font-size: 11px; line-height: 16px; color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; text-align: left;\">Solo queremos salir a jugar, no importa el lugar... no importa el rivaaaal ♫&nbsp;</p>','3393cafea7db07e398e001ed00d39218.jpg','#0a0808','#ffffff','#ffffff','#000000'),(144,12024,'<p><strong>FENIX ES UN EQUIPO CONFORMADO POR UN MIX DE VETERANOS Y JOVENES ENTRE HERMANOS Y AMIGOS, ALGUNOS DE LOS INTEGRANTES PARTICIPARON DE LA VERSION ANTERIOR DE COCOON, QUE SI BIEN TENIAMOS BUEN EQUIPO NO LLEGAMOS A OBTENER NINGUN TITULO SALVO UNA COPA DE VERANO.NUESTRO PRINCIPAL OBJETIVO ES SALIR CAMPEONES, NO ES PARA NADA SIMPLE PERO SABEMOS QUE SI SOMOS RESPONSABLES EN EL TRANSCURSO DEL TORNEO EN CUANTO AL COMPROMISO TENEMOS POSIBILIDADES.</strong></p>\n<p><strong>FUIMOS RESPONSABLES POR SUERTE EN ESTE TORNEO Y PODEMOS DECIR FELIZMENTE \"FENIX CAMPEON 2014 CATEGORIA B2\"</strong></p>','69b8a9b652fa8347b8409bf0b226cbd4.JPG','','','',''),(145,12025,'','silueta.jpg','#080707','#fafafa','',''),(146,12026,'','silueta.jpg','','','',''),(147,12027,'<p><em><strong>Un humilde equipo de amigos! Que prioriza la union del grupo por sobre todas las cosas. Un equipo joven, promedio de 20 a&ntilde;os.. La onda es divertirnos sabado a sabado, pasarla bien haciendo lo que mas nos gusta que es jugar al futbol!!</strong></em></p>','b3ad544d7f2b8c51ef1e0000beeace91.jpg','#0ca0f5','#f21616','',''),(148,12028,'','silueta.jpg','','','',''),(149,12029,'','ebf6b2721cc3727a6c1d7ba891ea36f3.jpg','#000000','#0009ff','',''),(150,12030,'','a44dc35962b38b9798c978816d21a1a8.jpg','#1805ed','#e9eef2','#f2efef','#3bf7f7'),(151,12031,'','silueta.jpg','','','',''),(152,12032,'<p>Equipo surgido desde hinchas Leprosos y fanaticos de el Loco Bielsa. Despues de un tiempo el plantel se empezo a formar con buenos jugadores sin importar el club del cual es hincha, sino el buen pie.</p>\n<p>Para el tercer tiempo el equipo entrena sin cansancio, en los bares rosarinos y esa es su mayor motivacion.&nbsp;</p>','0263b27a0ff597913c1f9cd8684b0f1c.jpg','#6ef713','#fcf9f9','#0d0c0c','#f70a0a'),(153,12033,'','silueta.jpg','#06b306','#fcfcfc','#ffffff',''),(154,12034,'','9f5744d8903d883fd30b5b955654c7dd.jpg','#74798c','#6698e3','#ffffff','#000000'),(155,12035,'','silueta.jpg','#2914c9','#f2e12c','#3322f0','#d7f26a'),(156,12036,'<p>Equipo que lleva a Jap&oacute;n como un estilo de vida</p>','06ecab55f18e43de949ef42098d58072.jpg','#0c0887','#121291','','#f7f7f7'),(157,12037,'<p>Todo comenzo un sabado a la noche en la ypf de cordoba y avellaneda.. cuando hablamos el emi, el fede y yo.. y decidimos formar un equipo en una liga.Inmediatamente nos comunicamos con el gran capitan Tatovich lo cual lo llamamos y le preguntamos tatovich como estas para jugar un torneo y el nos responido como un Perro de presa al 100 como el tomatito pena. ahi con la aceptacion de nuestro capitan decidimos formar el famoso cabiomansa&nbsp;</p>','a2ff44d6a52e21114035eb83ae885238.jpg','#edf50a','#e60c25','',''),(158,12038,'','silueta.jpg','#3929b0','#050000','','#432fa8'),(159,12039,'','silueta.jpg','','','',''),(160,12040,'','silueta.jpg','','','',''),(161,12041,'','silueta.jpg','','','',''),(162,12042,'<p>EQUIPO FORMADO POR PRIMOS , HERMANOS Y AMIGOS</p>','silueta.jpg','#1f1a1a','#e86427','#faf7f7','#f2763d'),(163,12043,'','silueta.jpg','','','',''),(164,12044,'','silueta.jpg','','','',''),(165,12045,'','silueta.jpg','','','',''),(166,12046,'<hr />','4a76035ead67f81bb8ae916a40d504c7.jpg','#f70d0d','#14368c','#0e2980','#f2f7f3'),(167,12047,'','silueta.jpg','','','',''),(168,12048,'<p>Campeon cat. D2- 2012</p>','bfd02fd79d1273eb59c7521df1423781.png','#e8cb0c','#223ce3','',''),(169,12049,'','silueta.jpg','','','',''),(170,12050,'','silueta.jpg','','','',''),(171,12051,'','e1c75c5986fdebbd9dbc8f1a7ed664a0.png','#6b77ff','#ff6363','',''),(172,12052,'','silueta.jpg','','','',''),(173,12053,'','silueta.jpg','#051fa3','#ccbc0e','#030303','#e80cc7'),(174,12054,'','4034bb04af4a040a3c284c3d29a318fb.jpg','#f5bff1','#170e0e','#ffffff','#f7aff5'),(175,12055,'<p>Simplemente, sin historia, un equipo por nacer, con muchas ganas de gozo, triunfos, ascensos y porque no campeonatos. Un equipo de Cochinos.</p>','silueta.jpg','#c92889','#bf358c','#b31616','#cf2121'),(176,12056,'<p>tiki tiki, nada de pelotasoss</p>','8b6e88f537f06b47f8a5c4df45fb60e5.jpg','#9e0e0e','#58c2cc','',''),(177,12057,'','ab5c7a6dddf5f87361d92b1d8ef8cc17.jpg','#000000','#1b850d','',''),(178,12058,'<p>Campe&oacute;n Torneo Clausura 2012 en la categor&iacute;a E2</p>','fce0f4fdd2f8e01b1772a410f62a8dd7.jpg','#b700ff','#b700ff','#fc0000',''),(179,12059,'','silueta.jpg','#048a24','#e8e8e8','',''),(180,12060,'<p>\"<strong>La Ochava no escapa a la reminiscencia de su nombre. La Ochava es un rinc&oacute;n, es un punto donde se juntan las cosas. La Ochava es nuestra &ldquo;esquina del infinito&rdquo;. La Ochava es un encuentro, es un juntarse, tirar paredes, quedar mano a mano, definir y compartir el abrazo de gol. La Ochava es un no lugar y un no tiempo. La Ochava es situaci&oacute;n y movimiento. La Ochava puede ser porr&oacute;n, puede ser asado. Puede ser charla, chiste. Puede ser cumbia y ricotero rock and roll. Puede ser verde c&eacute;sped, pelota al pie y gol</strong>. \"</p>','b719626af0abeba3ef129ac866cc03a6.jpg','#09f238','#f79708','#0bf703','#f5f5f5'),(181,12061,'<p>El Club Cultural (El verde, como es conocido por los hinchas ) tiene 62 a&ntilde;os de historia, es de Wheelwright, Santa Fe, por cuestiones de presupuesto hace varios a&ntilde;os que no puede hacer futbol, y como la mayoria de los integrantes del equipo hizo inferiores y es hincha del club, homenajeamos al mismo poniendole el nombre del equipo, \"Mi vieja me dio la vida el verde el corazon\" Las caracterisricas historicas de club son la humildad y garra, adjetivos que nos sentimos identificados.... Vamos Verde!!!!!!</p>','73667d4bc4be815f2e4aa18784109848.jpg','#1bdb21','#20d635','#dfedea','#d3e8e2'),(182,12062,'','silueta.jpg','','','',''),(183,12063,'','39f2fea1d413b7de5cfd336409d151a6.jpg','#f5f2f2','#4f4a4a','#080808','#030303'),(184,12064,'','silueta.jpg','#18f23c','#f0e7e7','#13700b','#0b570d'),(185,12065,'','silueta.jpg','#a6e1e3','#e2f0f0','',''),(186,12066,'','silueta.jpg','','','',''),(187,12067,'','silueta.jpg','','','',''),(188,12068,'','silueta.jpg','','','',''),(189,12069,'','silueta.jpg','','','',''),(190,12070,'','3e80ae8ffb52ba41047c90dd566a6043.jpg','','','',''),(191,12071,'','09f1ef5abcf81dd7d531bf9741226033.jpg','#080ff0','#000000','#f7efef','#0a0a0a'),(192,12072,'<p style=\"text-align: center;\"><strong>TAMO JUSTO<br /></strong></p>','silueta.jpg','#051685','#ffffff','#ff0000','#0e6b01'),(193,12073,'<p>Campe&oacute;n Liga Tifosi Categoria \'A\' 2012</p>','silueta.jpg','#fc0000','#ffffff','',''),(194,12074,'','silueta.jpg','','','',''),(195,12075,'<p><strong>Atalanta , comenzo como un equipo barrial de barrio belgrano hace casi 3 decada pasada, formando el equipo con muchos jugadores esencial de la zona oeste, viajando a un torneo muy dificil en Santiago del estero saliendo primero en la copeticion deportiva de futbol, luego con el tiempo fue desapareciendo, recordando y quedando en la historia el unico equipo en rosario zona oeste como el campeon de esa copa..&nbsp;</strong></p>\n<p><strong>pasando los a&ntilde;os, El hijo ( sebastian cabral ) de unos de los mejores jugadores del viejo atalanta, (osvaldo cabral) actualmente DT del equipo, sebastian cabral regresando a ese equipo recordado en el barrio, volvio a renovar su fama incribiendose en el torneo stella mari.. renovando jugadores y gente nueva, camisetas, paginas etc...&nbsp;</strong></p>\n<p><strong>en un debut del torneo muy bueno, siendo finalista de la CAT E2 &nbsp;partisipando en el torneo su primer a&ntilde;o 2012... atalanta fue en su zona unos de los mejores equipo goleando en muchas ocaciones..&nbsp;</strong></p>\n<p><strong><br /></strong></p>\n<p><strong>en la final aunque no tuvo un gran partido perdiendo por 4 a 1 la gente las 40 personas con festejo y todo, siguieron seguiendolo igual .....</strong></p>\n<p><strong>hoy en Dia cuenta con un equipo potente al acender&nbsp;</strong></p>','4867c8daecb1b80055dd4ce98aa05c91.JPG','#05057d','','#080606','#020563'),(196,12076,'','silueta.jpg','','','',''),(197,12077,'','silueta.jpg','','','',''),(198,12078,'','silueta.jpg','','','',''),(199,12079,'','silueta.jpg','','','',''),(200,12080,'','silueta.jpg','','','',''),(201,12081,'','silueta.jpg','#fcfcfc','#ffffff','#ede60c','#292926'),(202,12082,'','4b92efaa8cccba85d1560ae74784c92d.jpg','','#320ee6','#190096',''),(203,12083,'','silueta.jpg','','','',''),(204,12084,'<p>&nbsp;<strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://img809.imageshack.us/img809/3227/wss8.jpg\" alt=\"\" /></strong></p>\n<p><strong>Internados F.C.</strong></p>\n<p><br /><strong>Equipo de amigos que inicio su juego en el Torneo el a&ntilde;o 2011. </strong></p>\n<p><strong>Luego de pasar por una reestructuraci&oacute;n, finalmente se ha consolidado el equipo y est&aacute; definido intentando luchar para sumar puntos d&iacute;a a d&iacute;a.</strong></p>\n<p>&nbsp;</p>\n<p><strong>Futbol con humildad y mucha garra!</strong></p>','66e65e7230ebd3dabd73ba5670b39b18.JPG','#1d00fc','#000000','',''),(205,12085,'','silueta.jpg','','','',''),(206,12086,'','silueta.jpg','','','',''),(207,12087,'','2d59bf8cae9662c12de4d4eafe6e94e0.jpg','#00bfff','#000000','',''),(208,12088,'','silueta.jpg','','','',''),(209,12089,'','9f34d036741f329bdddb036034763736.jpg','#0e07d9','#080000','#0505f7','#f5f5fa'),(210,12090,'','0ad56a6d40b7d3024a3da8ea063842c6.jpg','#cff72d','','','#c7f259'),(211,12091,'','f0add11613ece0113ca745e4ebeb8cd0.jpg','#e4eb17','#f20e0e','#f2eded','#e0e01b'),(212,12092,'','2d8b89f1cf28803bcf3bd8116dbfa63f.png','#ffffff','','',''),(213,12093,'','0c0d20a039c630967c35fd347af68f79.jpg','#e62525','#fffcfc','',''),(214,12094,'','silueta.jpg','','','',''),(215,12095,'','silueta.jpg','','','',''),(216,12096,'<p>Fundaci&oacute;n: 2003.</p>\n<p>- Campe&oacute;n Torneo Apertura 2007 - Club San Jos&eacute;</p>\n<p>- Ascenso a Categor&iacute;a D 2013 - Stella Maris</p>\n<p>- Ascenso a Categor&iacute;a B1 2013 - Stella Maris</p>\n<p>LARGA VIDA A JAMAICA!</p>\n<p>&nbsp;</p>','9d9e70864579a3506be152004374f5a3.JPG','#119c11','#b6c215','',''),(217,12097,'<p>Los origenes de Vele&acute; se remontan al a&ntilde;o 2005 en el club Provincial, destacandose en juveniles y en la cuarta categoria. Despues de una etapa oscura llamandose Gremio en la liga Baigorriense, resurge el mitico equipo, bautizado en ese momento como el Velez de la salada, ganado de punta a punta la liga de las estrellas. En el a&ntilde;o 2013 recala en esta liga en busca de desafios lograndodo varios titulos, y dando que hablar a la prensa. En el 2014, el plantel llega al profesionalismo de la mano de el spnsor EF ( EDUCATION FIRST) dando de esta manera un salto de calidad que marcaria su futuro.</p>\n<p>Logros Obtenidos:</p>\n<p>- 2012 Campeon Liga de las Estrellas.</p>\n<p>-2013 Campeon copa de verano, Stella Maris</p>\n<p>-2013 Campeon Copa de Plata, Stella Maris</p>\n<p>-2013 Valla menos vencida categoria E (Chiche Diaz)</p>\n<p>-2014 Campeon Categoria D , Stella Maris.</p>\n<p>-2014 Valla menos vencida Categoria D (Otra vez Chiche Diaz)</p>','a1605249c3b2c35611683d0881929a83.jpg','#070714','#374bb0','#25ed13','#0f0e0e'),(218,12098,'','acf730226d6b9e76e4a3fdf7ea552dd3.jpg','#c92b2b','#030369','#f2f0af','#ed4c37'),(219,12099,'','silueta.jpg','','','',''),(220,12100,'','silueta.jpg','','','',''),(221,12101,'','silueta.jpg','','','',''),(222,12102,'','silueta.jpg','','','',''),(223,12103,'','silueta.jpg','#6dede7','#ffffff','',''),(224,12104,'','silueta.jpg','','','',''),(225,12105,'<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111; text-align: center;\">\"Sin sacrificio, no hay victoria\"</h2>\n<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111;\">1. No importa cu&aacute;ntas veces ta caigas sino c&oacute;mo seas capaz de levantarte</h2>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">&nbsp;</p>\n<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111;\">2. Aprende de tus errores, anal&iacute;zalos, busca sus causas y se capaz de transformarlos en fortalezas</h2>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">&nbsp;</p>\n<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111;\">3. Cuando me dices que no puedes hacer algo, ya hay otra persona interrumpi&eacute;ndote diciendo que est&aacute; hecho</h2>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">&nbsp;</p>\n<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111;\">4. Para llegar al &eacute;xito no pretendas hacerlo de repente, siembra poco a poco para recoger finalmente el fruto deseado</h2>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">&nbsp;</p>\n<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111;\">5. Fracasar es duro, no cabe duda de ello, pero no intentarlo no debe pas&aacute;rsete por la cabeza tan siquiera</h2>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">&nbsp;</p>\n<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111;\">6. Si no te valoras t&uacute;, no valorar&aacute;s nunca tu tiempo, y, hasta que no valores tu tiempo nunca har&aacute;s nada con &eacute;l. Y es que el tiempo es lo m&aacute;s valioso que tienes</h2>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">&nbsp;</p>\n<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111;\">7. Aprende a escuchar, hazlo, por eso tenemos dos orejas y una sola boca, para escuchar el doble de lo que hablamos</h2>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">&nbsp;</p>\n<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111;\">8. El secreto del &eacute;xito es tener confianza en uno mismo. Si quieres puedes y si puedes&hellip; HAZLO, pero hazlo ya</h2>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">&nbsp;</p>\n<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111;\">9. Si hace lo que has hecho siempre no llegar&aacute;s m&aacute;s lejos de lo que siempre has llegado. Haz m&aacute;s y llegar&aacute;s m&aacute;s lejos</h2>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">&nbsp;</p>\n<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111;\">10. Contra el miedo esc&eacute;nico hay dos buenos ant&iacute;dotos, el conocimiento y la acci&oacute;n, aprende constantemente y aplica dichos conocimientos</h2>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">&nbsp;</p>\n<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111;\">11. Si eres capaz de desafiar un gran fracaso, sin duda podr&aacute;s obtener un gran &eacute;xito</h2>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">&nbsp;</p>\n<h2 style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 20px; line-height: 24px; vertical-align: baseline; color: #111111;\">12. Todo buen motivador deber&iacute;a aprenderse casi de memoria este texto, es un fragmento obtenido integro de la pel&iacute;cula Un Domingo Cualquiera de Al pacino:</h2>\n<blockquote style=\"margin: 0px 0px 20px 10px; padding: 0px 0px 0px 40px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 15px; font-style: italic; line-height: inherit; vertical-align: baseline; quotes: none; background-image: url(\'http://unadocenade.com/wp-content/themes/newsroom14/img/shortcodes/blockquote.png\'); color: #111111; background-position: 0px 0px; background-repeat: no-repeat no-repeat;\">\n<p style=\"margin: 0px 0px 0.75em; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">La verdad es que no s&eacute; qu&eacute; decir. Quedan tres minutos para la batalla m&aacute;s grande de nuestra vida profesional. Todo se reduce a hoy. O bien nos rehacemos como equipo o nos desmoronamos. Cent&iacute;metro a cent&iacute;metro, jugada a jugada, hasta que estemos acabados. Estamos en el infierno, caballeros. Creedme. Y podemos quedarnos aqu&iacute; y que nos den una puta paliza, o bien podemos luchar y abrirnos paso de nuevo hacia la luz. Podemos salir del infierno cent&iacute;metro a cent&iacute;metro.<br />Yo no puedo hacerlo por vosotros. Soy demasiado viejo. Miro a mi alrededor, veo estos rostros j&oacute;venes y pienso. Quiero decir&hellip; He tomado casi todas las decisiones equivocadas que un hombre de mediana edad puede tomar. Yo, eh&hellip; Me pul&iacute; todo mi dinero, lo cre&aacute;is o no. Di la espalda a todo aqu&eacute;l que me am&oacute; alguna vez. Y &uacute;ltimamente no puedo ni mirarme al espejo.</p>\n<p style=\"margin: 0px 0px 0.75em; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">&iquest;Sab&eacute;is? Cuando te haces viejo te lo quitan todo. Es parte de la vida. Pero s&oacute;lo aprendes en el momento en que empiezas a perder cosas. Descubres que la vida es un juego que se mide en cent&iacute;metros.</p>\n<p style=\"margin: 0px 0px 0.75em; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Tambi&eacute;n lo es el f&uacute;tbol. Porque en cada partido, en la vida o en el f&uacute;tbol, el margen de error es tan estrecho. Quiero decir&hellip; medio paso demasiado tarde o muy pronto y no llegar&aacute;s; medio segundo demasiado lento o muy r&aacute;pido y no lo atrapar&aacute;s. Los cent&iacute;metros que necesitamos est&aacute;n por todas partes. Est&aacute;n en cada descanso del partido, en cada minuto, en cada segundo.</p>\n<p style=\"margin: 0px 0px 0.75em; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">En este equipo luchamos por ese cent&iacute;metro. En este equipo nos dejamos la piel y destrozamos a todo el mundo a nuestro alrededor por ese cent&iacute;metro. Ara&ntilde;amos con nuestras u&ntilde;as por ese cent&iacute;metro. Porque sabemos que sumando todos esos cent&iacute;metros vamos a marcar la puta diferencia entre GANAR o PERDER, entre VIVIR o MORIR.</p>\n<p style=\"margin: 0px 0px 0.75em; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Escuchad lo que os digo: en cualquier batalla es el t&iacute;o que est&eacute; dispuesto a morir el que va a ganar ese cent&iacute;metro. Y s&eacute; que si voy a vivir un poco m&aacute;s es porque conservo la voluntad de luchar y morir por ese cent&iacute;metro, porque VIVIR es eso. Los seis cent&iacute;metros que tienes delante.</p>\n<p style=\"margin: 0px 0px 0.75em; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Yo no puedo obligaros a hacerlo. Ten&eacute;is que mirar al tipo que ten&eacute;is a vuestro lado. Miradle a los ojos. Ver&eacute;is a alguien que recorrer&aacute; ese cent&iacute;metro con vosotros. Ver&eacute;is a alguien que se sacrificar&aacute; por este equipo porque sabe que, llegada la hora, vosotros har&eacute;is lo mismo por &eacute;l.</p>\n<p style=\"margin: 0px 0px 0.75em; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Eso es un equipo, caballeros. O bien nos rehacemos ahora, como un equipo, o nos desmoronamos como individuos. Eso es el f&uacute;tbol, chicos. Nada m&aacute;s. Decidme, &iquest;qu&eacute; vais a hacer?</p>\n</blockquote>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">Sencillamente maravilloso&hellip;Nada m&aacute;s. Decidme, &iquest;qu&eacute; vais a hacer?</p>\n<p style=\"margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: \'Droid Serif\', serif; font-size: 14px; line-height: 21px; vertical-align: baseline; color: #444444;\">&nbsp;</p>','270dbc8860f0dabffe71518048e06a5b.jpg','#f5fafa','#4a40b8','#1e403b','#a18142'),(226,12106,'<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><em><strong>Charly Vive</strong></em></span></p>','9a1d026c07080f60c86ba2148a6597de.jpg','#25992e','','',''),(227,12107,'','72444c864c6a7cf145b208dbbdfefaf4.jpg','#ffd500','#fce80a','#000000','#ffffff'),(228,12108,'','265ac0ac939d58994dc76f925de11048.jpg','#30c961','#f7f4f4','#141212','#f5f0f0'),(229,12109,'','silueta.jpg','','','',''),(230,12110,'<p>El equipo se fue formando luego de varios a&ntilde;os jugando f&uacute;tbol 5 entre amigos y parientes.</p>\n<p>A comienzos del a&ntilde;o 2013 decidimos formar un plantel fijo para lograr nuevas rivalidades futbol&iacute;sticas en algo que nos apasiona, de la mano de nuestra entrenadora J&eacute;sica.</p>\n<p>En julio de ese mismo a&ntilde;o, nuestro m&aacute;ximo logro fue: llegar a semifinales de la copa repechaje de invierno.</p>\n<p>Este a&ntilde;o vamos por m&aacute;s...</p>\n<p>&nbsp;</p>','497e634fa8cb55a0d16bca2a69249467.JPG','#7cab77','#030303','#e3db71','#fafafa'),(231,12111,'<p><span style=\"color: #222222; font-family: Helvetica; font-size: 13px; line-height: 19px;\">No estoy de acuerdo con eso de separar ganar y jugar bien. No es justa la divisi&oacute;n de la jerarqu&iacute;a de los recursos y de la victoria como hechos independientes. No hay camino m&aacute;s corto y agradable como la belleza del juego. No me parece bien que el planteo tenga que hacerse con tendencia a separarlos. Se escucha mucho la pregunta ganar o jugar bien. Creo que deber&iacute;a ser una afirmaci&oacute;n:<em><strong> jugar bien para ganar</strong></em>, y no una interrogaci&oacute;n entre dos opciones.</span><br style=\"outline: none 0px; color: #222222; font-family: Helvetica; font-size: 13px; line-height: 19px;\" /><span style=\"color: #222222; font-family: Helvetica; font-size: 13px; line-height: 19px;\">Yo soy un convencido de que hay que saber jugar mal. Y para eso, lo primero que se debe hacer es aceptar ese hecho no deseado para llevar el partido a un terreno neutro e intentar mejorar desde all&iacute;.</span><br style=\"outline: none 0px; color: #222222; font-family: Helvetica; font-size: 13px; line-height: 19px;\" /><span style=\"color: #222222; font-family: Helvetica; font-size: 13px; line-height: 19px;\">Me importa much&iacute;simo ganar y para eso quiero que mis equipos jueguen bien, pero entiendo que se puede no ganar y que eso no necesariamente tiene que significar un fracaso. El f&uacute;tbol no es una cuesti&oacute;n matem&aacute;tica.</span></p>\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong><em style=\"font-weight: bold; font-style: normal; font-family: arial, sans-serif; font-size: small; line-height: 16px; text-align: left;\">Lo importante es la nobleza de los recursos utilizados.</em></strong></span></p>\n<p style=\"text-align: center;\"><em><strong><span style=\"color: #222222; font-family: Helvetica;\"><span style=\"font-size: 12.800000190734863px; line-height: 19px;\"><span style=\"text-decoration: underline;\">MARCELO BIELSA</span><br /></span></span></strong></em></p>\n<p style=\"text-align: center;\"><em><strong><span style=\"color: #222222; font-family: Helvetica;\"><span style=\"font-size: 12.800000190734863px; line-height: 19px;\"><span style=\"font-family: Helvetica;\"><span style=\"font-size: 12.800000190734863px;\">VPLD</span></span></span></span></strong></em></p>\n<p style=\"text-align: left;\"><em><strong><span style=\"color: #222222; font-family: Helvetica;\"><span style=\"font-size: 12.800000190734863px; line-height: 19px;\">APERTURA 2013 : </span></span></strong></em><strong><span style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 17px;\">19PJ 13PG 4PE 2PP 53GF 23GC 30DG (HEXAGONAL INCLUIDO: 6 GANADOS DE 6 Y ASCENSO A LA D1)</span></strong></p>\n<p style=\"text-align: left;\"><em><span style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: x-small;\"><span style=\"line-height: 17px;\"><strong>CLAUSURA 2013 : </strong></span></span></em><span style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: x-small;\"><span style=\"line-height: 17px;\"><strong>13PJ 8PG 2PE 4PP 39GF 20GC 19DG</strong></span></span></p>\n<p>&nbsp;</p>','d0e9aa950828a5cb7fbec091d71f8bc6.JPG','#fcf9f9','#fa0a0a','#03005c','#02026e'),(232,12112,'','5c87eea9d744a41b50142ddb6b6454b5.png','#71e344','#faf9eb','',''),(233,12113,'','silueta.jpg','','','',''),(234,12114,'<p>Equipo el riel grupo de amigos del barrio que se reune para pasar un buen momento y hacer magia con el balon</p>\n<p>&nbsp;</p>','6f4c9253b94c559e7df52ce82e5dcb4f.jpg','#f0cd1d','#0f0e0e','#34522b','#e3c54d'),(235,12115,'','silueta.jpg','#19e320','','#fcfcfc',''),(236,12116,'<p>Tras varios torneos en distintas ligas de Rosario, y una depuracion y recambio de jugadores, este grupo de Amigos llega con todas las expectativas a este nuevo arranque buscando orden y un progresivo crecimiento.</p>\n<p><strong>Con esfuerzo y buenas intenciones, Todo Llega!!!!</strong></p>','fa2e1a96dd96769a46b5fc34d123cf4b.jpg','#0800fc','#fa0303','',''),(237,12117,'','silueta.jpg','','','',''),(238,12118,'','silueta.jpg','','','',''),(239,12119,'','silueta.jpg','','','',''),(240,12120,'','silueta.jpg','','','',''),(241,12121,'','silueta.jpg','','','',''),(242,12122,'','silueta.jpg','','','',''),(243,12123,'','silueta.jpg','','','',''),(244,12124,'','silueta.jpg','','','',''),(245,12125,'<p 