INSERT INTO `notas` VALUES (1,161,'2014-07-30',' Jorge Rosas y Pablo Venturelli 2 de las figuras de Los Satrapas','','c61ccfa79091f0bacf1774711df83f95.MP3',''),(2,161,'2014-07-30','Matias Rodriguez el Arquero Super Campeón De Los Satrapas','','51eeed94c7cc8fc1d8ec5ac1c7785e41.MP3',''),(3,161,'2014-07-30','Particulares de La Mano De Adrián y Maxi se consagro campeón de la Copa Repechaje','','5db6e6353b57b554a211e54d951fd309.MP3',''),(4,161,'2014-07-30','Las Palmeras Campeón de La Copa De Campeones','','084dd7760e060bb80536cad70f18ca24.MP3',''),(5,161,'2014-07-30','HaWai Campeón de una de las Copa De Soñando con el Gol','','c291fb3bb1fbb70be6df3aef0e40f4fb.MP3',''),(6,161,'2014-07-30','Big Bola Campeón De La Copa Soñando con el Gol','','fe55f797ae05e0e653db3a78abf5c53b.MP3',''),(7,161,'2014-07-30',' El Riel es uno de los nuevos de la divisional B','','70e21306067b9e5b9d35ae0a55ecd71c.MP3',''),(8,161,'2014-07-30','Las Sobras Grito Campeón','','8740a995259c3d873528dae7cc64120d.MP3',''),(9,161,'2014-07-30',' Tomba otro nuevo integrante de la categoría B','','60e9efd2f376dcb3010780a033b9bcb4.MP3',''),(10,161,'2014-07-30',' Deportivo Español se suma a los equipos de la A','','b0b923b9f175c01a6fabe380a3c711df.MP3',''),(11,161,'2014-07-30','Albatros es de la A','','f5e6ce394177c77807aa4b5b63b399a5.MP3',''),(12,161,'2014-07-30',' Los Apud nuevo integrante de la categoría C','','dd7a64765bfd85835a3fae7a8c73fdea.MP3',''),(13,161,'2014-07-30',' Chamby cumplió la meta llego a la A','','d1588cf68f55d06b091ccc2aabc0d8df.MP3',''),(14,161,'2014-07-30','Ferrugem ascendió a la divisional B','','42b99a93e6e366bf05b5fbfa8802e133.MP3',''),(15,161,'2014-07-30',' Entrevista con Gaston','','d6ef66eaf64c647f1b388409890d9b95.MP3',''),(16,161,'2014-07-30','La Ochava mostró actitud en el juego','','5e31a5649b5853e9a6b2fd1570b026ff.MP3',''),(17,161,'2014-07-30','Ibiza se transformo en uno de los nuevos equipos de la A','','99c85b59a2f7192fce00f0bda5232f96.MP3',''),(18,161,'2014-07-30','Los Lacra debutaron en la Liga de Soñando con el Gol','','2d7dddf099dba84f9da6f85abeb53789.MP3',''),(19,161,'2014-08-05',' Casu centra su objetivo en ascender a la B','','ff5cf9bbcd749e8d26509706e4c1990d.MP3','<p>&nbsp;Transcurrida la primera Fecha Del Torneo Clausura , Casu empato 1 a 1 con Inter, el equipo dispuso de varias ocasiones de gol, pero no las pudieron concretar y el resultado final fue empate. A continuaci&oacute;n escuchamos una entrevista con uno de los jugadores de Casu</p>'),(20,161,'2014-08-05',' Bayern MFC debuto con un triunfo','','b92516da87c87deffbd3a16ccc2cdf02.MP3','<p>Natanael uno de los fundadores del equipo, afirmo que obtuvieron un triunfo muy importante sobre Tento Fc y que el equipo mostro solidez en todo momento.</p>'),(21,161,'2014-08-05','La Banda Del Guiso un equipo que busca progresar en el juego','','cddcc8c6da3b78b6dcd215a25fc240e2.MP3','<p>&nbsp;Seba arquero de La Banda Del Guiso, se&ntilde;alo que el equipo perdi&oacute; a raiz de que fallo en la definici&oacute;n y el objetivo que persiguen en los pr&oacute;ximos partidos es mejorar en todas las lineas de juego.</p>'),(22,161,'2014-08-05','Big Bola un festejo a lo Grande','','0d36b077440bdf86eaf87311aa41d214.MP3','<p>&nbsp;Los pibes de Big Bola se consagraron campeones de una de las copas de So&ntilde;ando con el Gol, tras el partido del s&aacute;bado de la primera fecha del Torneo Clausura, Lalo y Lisandro afirmaron que est&aacute;n muy contentos, con la obtenci&oacute;n del campeonato y que van por m&aacute;s</p>'),(23,161,'2014-08-05',' Presidiarios De La Malta, debuto con una goleada','','4a374fb4dc658bc39bd06a5438d94c67.MP3','<p>&nbsp;Nico Leyes una de las nuevas caras de P De La Malta, sostuvo que el equipo tiene actitud en el juego y eso s debe a ra&iacute;z del compromiso que tienen todos los jugadores a la hora de jugar.</p>'),(24,161,'2014-08-05',' Simplemente Fútbol debuto en La Liga De Soñando con el Gol','','e74500cd504aadaca2da921332bf5ddd.MP3','<p>&nbsp;Gaby Maziero capit&aacute;n de Simplemente F&uacute;tbol, remarco que el equipo pregona un juego de jugar on la pelota al piso y a medida que transcurran los partidos el equipo, empezar&aacute; a mostrar esa faceta en el juego</p>'),(25,161,'2014-08-05',' Tronquito Fc es uno de los nuevos equipos de la Categoría C','','9fb1ba02d0d27e4f620f5abac05998b1.MP3',''),(26,161,'2014-08-06',' Las Perlas de la 1° Fecha Del Torneo Clausura 2014-08-06  1','','','<p class=\"MsoNormal\"><span lang=\"ES-AR\">1) Cat A: La mayor Goleada fue Verde Amarelo 6-&nbsp; Fenix 2, 2) B1:&nbsp; El cotejo de la jornada fue: Comunicaciones 6- Giotto 4, 3)&nbsp;&nbsp; B 2: Se registro un solo empate entre El Traidor 2- Fonavi Oeste 2, 4)&nbsp; C1: Lanus de La Mano de su entrenador Luis Caro, debuto con un triunfo al vencer por 2 a 0 a El Cilindro, 5) C2: Cruz Azul y Los Apud, no recibieron goles en contra, 6) C 3: Vele fue eficaz en el juego y goleo por 5 a 0 a Chicago Fc, 7) D1: San Mart&iacute;n De Rosario, fue un carnaval de goles, gole&oacute; por 7 a 4 a Tano Pastina Fc, 8) D 2: &nbsp;Elles y La Aplanadora Fc, ganaron sus respectivos partidos por 4 a 0, 9) &nbsp;D3: En uno de los cl&aacute;sicos de la fecha Hawai y Las Sobras empataron 2 a 2, 10) D 4: &nbsp;Perla&nbsp; Negra debuto con una goleada al vencer por 4 a 1 a Viejo Munich</span></p>'),(27,161,'2014-08-06',' Ibiza debuto en la categoría A','','aab478ee43b609c7217bb8bcc5b214ae.MP3','<p>&nbsp;Luciano uno de los jugadores de Ibiza, afirmo que lo importante en el equipo, m&aacute;s &aacute;lla del juego, son los valores humanos que se formaron</p>'),(28,161,'2014-08-06','Cristalería Campeón de La C 1','','85022255b3e3c8df17ef2cc470edc793.MP3',''),(29,161,'2014-08-06',' Lisandro Arferi y Patricio Oliva 2 de las figuras de Bilbao','','12eb934bb4e429bc9b0433c3683721f9.MP3','<p>&nbsp;Ambos jugadores destacaron entre otras situaciones que el objetivo del equipo esta centrado en llegar a la divisional A</p>'),(30,161,'2014-08-06',' Vele es uno de los nuevos de la categoría C','','bd5b9d508e6de197d7b9fb33cdb7ca63.MP3',''),(31,161,'2014-08-06',' Las Palmeras recibió el premio como campeón de la Copa De Campeones','','','<p>Matias Perez, uno de los fundadores de Las Palmeras, &nbsp;se&ntilde;alo que hace 4 a&ntilde;os que juegan en la Liga y que les restaba por lograr el T&iacute;tulo de La Copa De Campeones, afirmaron estar muy contentos y finalizo diciendo que esto se debe al gran trabajo en equipo que hay, por parte de todos.</p>'),(32,161,'2014-08-06','  Ale Aragno fue elegido como el mejor jugador del Torneo','','f85714db8bc761b9c8f5faeaf1997a2d.MP3','<p>&nbsp;Ale Aragno , se adjudic&oacute; el bot&iacute;n de oro y declaro que este premio se los debe a sus compa&ntilde;eros, que en cada partido, lo alientan para que mejore su juego.</p>'),(33,161,'2014-08-11','Daniel  Torquati Entrenador de Jamaica','','fdf7d78298b6fd320cd0a8c51041f4ce.MP3','<p>&nbsp;El Dt de Jamaica manifesto una vez finalizado el partido frente a Los Gui-3, donde perdieron por 4 a 1, lo sig: &nbsp;que no est&aacute; faltando tener el plantel en forma completa , para poder ganar los partidos algo que espero que en los pr&oacute;ximos partidos se solucione</p>'),(34,161,'2014-08-11','Hawaii Gano por Goleada','','602de65e0b47687d55be73b5feddc956.MP3','<p>&nbsp;Transcurrida la 2 fecha del Torneo Clausura 2014, Hawaii goleo por 8 a 0 a Nlpn, Jesus uno de sus futbolistas afirmo que el equipo funciono a la perfecci&oacute;n en todas las lineas y que el objetivo en el presente, torneo es ser campe&oacute;n.</p>'),(35,161,'2014-08-11','Derqui apuesta a mejorar en el juego','','ac0b007188093af61a31a22e70b8a18a.MP3','<p>&nbsp;Pablo Meza una vez consumada la derrota frente a Cocobongo por 3 a 2, se&ntilde;alo que de cara a las pr&oacute;ximas fechas debemos mejorar en el aspecto defensivo, &nbsp;para lograr un optimo rendimiento en el Torneo</p>'),(36,161,'2014-08-11',' El Control sueña con ser campeón en la C 2','','410ed7979e0b92849e4c9ec27dbc3f70.MP3','<p>&nbsp;El Control derroto por 6 a 1 a Cruz Azul, en la entrevista con So&ntilde;ando con el Gol, Ariel Camplese, puntualizo que fueron efectivos con la pelota parada y adem&aacute;s sentenci&oacute; que aspiran a ser campeones en la C 2</p>'),(37,161,'2014-08-11',' El Traidor un Equipo con Actitud','','cf17fc0e51547b8c159a2e0c0ff852ff.MP3','<p>Ernesto y Federico Sassano una de las nuevas incorporaciones del El Traidor, remarcaron que obtuvieron una victoria fundamental frente a un gran equipo como Ferrugem A. C.</p>'),(38,161,'2014-08-11','Las Perlas De La 2 Fecha Del Torneo Clausura 2014','','','<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]-->1)<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Cat A: La Mayor Goleada fue La Bal&oacute;n 5- Las Palmeras 1, 2) Cat B 1: Los Del Turco Fc, fue el &uacute;nico equipo que no recibi&oacute; goles, el resultado final fue una victoria por 3 a 0 sobre Barrio Alvear, 3) B 2:&nbsp; 3 equipos ganaron por goleada: Los Gui-3, El Forraje F.C y Tiroteame Rocha, 4) C 1: &nbsp;En uno de los cl&aacute;sicos de la Fecha, Inter Fc derroto por 2 a 1 a Bicicleta, 5) C 2:&nbsp; Los Apud fue un carnaval de Goles gole&oacute; por 8 a 1 a Leyendas Del Sur, 6) C 3:&nbsp; Malvinas Argentinas fue s&oacute;lido en e juego y gole&oacute; por 5 a 0 a Almirante Scrum, 7) D 1:&nbsp; Tano Pastita Fc fue&nbsp; efectivo en la definici&oacute;n y goleo por 7 a 0 a Asturkon, 8) &nbsp;&nbsp;D 2:&nbsp; El partido de la Fecha fue Salsipuedes 4- Cabiomansa 3, 9) D 3:&nbsp; Fisherton F&uacute;tbol debuto con un triunfo al vencer por 2 a 0 a Alieris De Charly, 10)&nbsp; D 4: Simplemente F&uacute;tbol fue Toque , Gol y derroto por 4 a 1 a El City</p>');
